import './App.css';

function App() {


  const fetchTeams = () => {
    fetch('/competitions/')
      .then(res => res.json())
      .then(data => ({
        team: data,
      }))
  }

  return (
    <section>
      <button onClick={console.log(fetchTeams())}>GO</button>
    </section>
  );
}

export default App;
